    StepSixComponent.prototype.sortPrices = function (type) {
        if (type == 'DESC') {
            // document.getElementById("price-desc").classList.add("active-order");
            // document.getElementById("price-asc").classList.remove("active-order");
            this.filteredInsurances = this.filteredInsurances.sort(function (a, b) { return b.price - a.price; });
        }
        else if (type == 'ASC') {
            // document.getElementById("price-asc").classList.add("active-order");
            // document.getElementById("price-desc").classList.remove("active-order");
            this.filteredInsurances = this.filteredInsurances.sort(function (a, b) { return a.price - b.price; });
        }
        else {
            if (this.value_sort_up) {
                this.filteredInsurances = this.filteredInsurances.sort(function (a, b) { return a.dwelling - b.dwelling; });
                this.value_sort_up = false;
            }
            else {
                this.filteredInsurances = this.filteredInsurances.sort(function (a, b) { return b.dwelling - a.dwelling; });
                this.value_sort_up = true;
            }
        }
        // this.OwlElement.reInit();
        return;
    };
